"""Modelo
vai ter uma entrada em ceksius uma saida em fahrenraint um peso e um bias  


---

- Inicializar os pesos e bias
- Feedforward
- Calcular a perda
- Backpropagation
"""

#Inicializar

W= np.random.rand(1)
b=0

def forward(inputs, w, b):
  return w*inputs + b

def mse(Y, y):
  return (Y-y)**2

## v = np.array([3,4,5])
## u = np.array([3.2, 4.5, 4.8])

## mse(v, u)

#target-alvo, learn rating - taxa de aprendizagem
#calcular no backpropagation derivada do eixo em relação ao peso e derivada do peso em relação ao eixo
def backpropagation (inputs, outputs, targets, w, b, lr):
  dw = lr*(-2*inputs*(targets-outputs)).mean() #derivada
  db = lr*(-2*(targets-outputs)).mean()

  w -= dw
  b -= db

  return w, b

def model_fit(inputs, target, w, b, epochs= 200, lr=0.001):

  for epoch in range(epochs):

    outputs = forward(inputs, w, b)
    loss = np.mean(mse(target, outputs))
    w, b = backpropagation(inputs, outputs, target, w, b, lr)

    if (epoch+1) % 50 == 0: #fazendo laço de repetição pra impressão das epocas
      print(f'Epoch:[{(epoch+1)}/{epochs}] Loss: [{loss:.4f}]')

    return w, b

